import React from 'react';
import './Project.css';
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/css/bootstrap.min.css";
import { Card, CardColumns } from "react-bootstrap";
import CardItem from './CardItem';

import libary from '../image/Camera Roll/lb.png';
import libary_q from '../image/Camera Roll/lb2.png';

import dum1 from '../image/Dum/1.png';
import dum2 from '../image/Dum/2.png';
import dum3 from '../image/Dum/3.png';
import dum4 from '../image/Dum/4.png';
import dum5 from '../image/Dum/5.png';
import dum6 from '../image/Dum/6.png';
import dum7 from '../image/Dum/7.png';

import fbauth from '../image/Firebase Auth page/1.png'
import fbauth1 from '../image/Firebase Auth page/2.png'

import kivy1 from '../image/Kivy/1.png'
import kivy2 from '../image/Kivy/2.png'

import photo_feed1 from '../image/Saved Pictures/1.png'
import photo_feed2 from '../image/Saved Pictures/2.png'
import photo_feed3 from '../image/Saved Pictures/3.png'

import python from '../image/Screenshots/1.png'
import python1 from '../image/Screenshots/2.png'

import social_media1 from '../image/Social Media/1.png'
import social_media2 from '../image/Social Media/2.png'


const Project = () => {
  return (
    <div style={{alignItems:'center', justifyContent:'center'}}>

    <CardColumns>
      <Card>
        <Card.Img variant="top" src="http://askavy.com/demo/img/img-card.jpg" />
        <Card.Body>
          <Card.Title>Card title </Card.Title>

        </Card.Body>
        <Card.Footer>
          <small className="text-muted">Last updated 10 mins ago</small>
        </Card.Footer>
      </Card>

      <Card>
        <Card.Img variant="top" src="http://askavy.com/demo/img/img-card.jpg" />
        <Card.Body>
          <Card.Title>Card title</Card.Title>
          <Card.Text>
            Card Text his card has supporting text below as a natural lead-in to
            additional content.{" "}
          </Card.Text>
        </Card.Body>
        <Card.Footer>
          <small className="text-muted">Last updated 10 mins ago</small>
        </Card.Footer>
      </Card>

      <Card>
        <Card.Img variant="top" src="http://askavy.com/demo/img/img-card.jpg" />
        <Card.Body>
          <Card.Title>Card title</Card.Title>
          <Card.Text>
            Card Text his card has supporting text below as a natural lead-in to
            additional content.{" "}
          </Card.Text>
        </Card.Body>
        <Card.Footer>
          <small className="text-muted">Last updated 11 mins ago</small>
        </Card.Footer>
      </Card>
    </CardColumns>
  );
    </div>
  );
}


export default Project
